import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { TextField, Button, Card, CardMedia, CardContent, Typography, Grid, Dialog, DialogTitle, DialogContent } from "@mui/material";

const DMMSearch = () => {
    const [keyword, setKeyword] = useState("");
    const [items, setItems] = useState([]);
    const [actresses, setActresses] = useState([]);
    const [loading, setLoading] = useState(false);
    const [selectedImage, setSelectedImage] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        // おすすめ女優リストの取得 (ダミーデータ or API連携)
        setActresses([
            { name: "上原亜衣", image: "https://example.com/ai.jpg" },
            { name: "波多野結衣", image: "https://example.com/yui.jpg" }
        ]);
    }, []);

    const handleSearch = async () => {
        if (!keyword.trim()) return;
        setLoading(true);

        const response = await fetch(`https://73f92o14r4.execute-api.ap-northeast-1.amazonaws.com/dev/nostalgic?keyword=${keyword}`);
        const data = await response.json();

        setItems(data.items);
        setLoading(false);
    };

    return (
        <div style={{ padding: "20px", maxWidth: "900px", margin: "auto" }}>
            <Typography variant="h4" gutterBottom>DMM 商品検索</Typography>
            <TextField
                fullWidth
                label="キーワードを入力"
                variant="outlined"
                value={keyword}
                onChange={(e) => setKeyword(e.target.value)}
                style={{ marginBottom: "10px" }}
            />
            <Button variant="contained" color="primary" onClick={handleSearch} disabled={loading} fullWidth>
                {loading ? "検索中..." : "検索"}
            </Button>

            {/* おすすめ女優リスト */}
            <Typography variant="h6" style={{ marginTop: "20px" }}>おすすめ女優</Typography>
            <Grid container spacing={2}>
                {actresses.map((actress, index) => (
                    <Grid item xs={6} sm={3} key={index}>
                        <Card>
                            <CardMedia
                                component="img"
                                height="140"
                                image={actress.image}
                                alt={actress.name}
                                onClick={() => setSelectedImage(actress.image)}
                            />
                            <CardContent>
                                <Typography variant="body1">{actress.name}</Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>

            {/* 検索結果リスト */}
            <Typography variant="h6" style={{ marginTop: "20px" }}>検索結果</Typography>
            <Grid container spacing={2}>
                {items.map((item) => (
                    <Grid item xs={12} sm={6} md={4} key={item.affiliate_url}>
                        <Card onClick={() => navigate(`/product`, { state: { product: item } })}>
                            <CardMedia
                                component="img"
                                height="200"
                                image={item.image}
                                alt={item.title}
                            />
                            <CardContent>
                                <Typography variant="body1">{item.title}</Typography>
                                <Typography variant="body2" color="textSecondary">{item.maker}</Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>

            {/* 画像拡大用ダイアログ */}
            <Dialog open={Boolean(selectedImage)} onClose={() => setSelectedImage(null)}>
                <DialogTitle>拡大画像</DialogTitle>
                <DialogContent>
                    <img src={selectedImage} alt="拡大画像" style={{ width: "100%" }} />
                </DialogContent>
            </Dialog>
        </div>
    );
};

export default DMMSearch;
